{'publishedAt': '2023-02-27T16:37:25Z', 'channelId': 'UC-6xqzMBF2CXTImn_a4aCVg', 'title': 'Negócio é a nossa praia | Conheça a fotógrafa Marianna Rosa| Conteúdo de marca', 'description': 'Marianna Rosa é especializada em fotografia aquática e campeã brasileira de canoa havaiana. Formada em designer de moda, ela trabalhou na sua área de formação por 18 anos até se tornar fotógrafa e empreender nas praias do Estado. Hoje, ela fotografa dentro do mar e vende seu trabalho através de plataformas online.

Marianna Rosa está no terceiro episódio da segunda temporada do ""Negócio é a nossa praia” - uma série do Movimento Tem no Rio, parceria entre a @investe.rio.sa, agência de promoção e atração de investimentos da Prefeitura do Rio, e a Editora Globo.  

