{'publishedAt': '2023-01-30T17:43:55Z', 'channelId': 'UC-6xqzMBF2CXTImn_a4aCVg', 'title': 'Negócio é a nossa marca | Conheça a história da Farm  | Conteúdo de marca', 'description': 'Criada para “colorir” as meninas do Rio em 1997, a Farm começou com um investimento de R$1,2 mil e faturou R$1,66 bilhão em 2022. Hoje com 90 lojas, o e-commerce da marca representa 40% de tudo o que vende. São 1.700 multimarcas espalhadas pelo Brasil e com produtos direcionados também para meninos de todas as idades.   

Em expansão global desde 2019, a Farm tem pontos físicos em Nova Iorque e Miami, nos Estados Unidos, e uma pop-up store em Paris. Para Marcello Bastos, sócio-diretor da Farm, a marca que fatura 30% no exterior, estará em breve entre as dez melhores do mundo no setor da moda.  Dá o play para conhecer a o terceiro episódio da série "Negócio é a nossa moda". Uma série do Movimento Tem no Rio, parceria entre a @investe.rio.sa, agência de promoção e atração de investimentos da Prefeitura do Rio, e a Editora Globo.  

*Conteúdo de marca apresentado por Farm.', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/lsi8XTKPKRE/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/lsi8XTKPKRE/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/lsi8XTKPKRE/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/lsi8XTKPKRE/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/lsi8XTKPKRE/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Jornal O Globo', 'playlistId': 'UU-6xqzMBF2CXTImn_a4aCVg', 'position': 294, 'resourceId': {'kind': 'youtube#video', 'videoId': 'lsi8XTKPKRE'}, 'videoOwnerChannelTitle': 'Jornal O Globo', 'videoOwnerChannelId': 'UC-6xqzMBF2CXTImn_a4aCVg'}

{'publishedAt': '2022-12-14T14:21:09Z', 'channelId': 'UC-6xqzMBF2CXTImn_a4aCVg', 'title': 'Download Web Summit traz destaques da edição de Lisboa e expectativas para festival no Rio', 'description': 'O Web Summit, uma das maiores conferências de tecnologia do mundo, teve sua última edição em novembro, em Lisboa, discutindo o futuro a partir da inovação. Para debater e analisar os temas mais relevantes que foram abordados por lá, o Download Web Summit Rio reúne parceiros e organizadores do evento, líderes empresariais, autoridades e jornalistas brasileiros que estiveram presentes no festival, num encontro realizado por O GLOBO e Época Negócios, com apresentação do Senac RJ. A expectativa sobre a edição carioca, em 2023, também terá espaço.
Com plateia de convidados, o evento acontece no auditório da Fecomércio nesta quarta-feira, dia 14/12, a partir das 9h, e terá transmissão pelas redes sociais e sites dos três veículos. 
Participam 
Artur Pereira, VP, Country Managing Director Portugal do Web Summit; 
Antonio Queiroz, presidente da Fecomércio; 
Franklin Costa, cofundador da Clb; 
Paula Rizzo, TV Globo; 
Daniela Braun, do Valor Econômico; 
Juliana Causin, da Época Negócios; 
Eduardo Paes, prefeito do Rio; 
Chicão Bulhões, secretário de Desenvolvimento Econômico, Inovação e Simplificação do Rio; 
Sérgio Ribeiro, diretor regional do Senac RJ;
Rodrigo Stallone, diretor de Novos Negócios na Transfero; e 
Hector Gusmão, CEO e Founder da Bolder e da 42Rio. 

