{'publishedAt': '2022-06-28T11:00:31Z', 'channelId': 'UC-6xqzMBF2CXTImn_a4aCVg', 'title': 'Moda Firjan Senai - Conheça Idenilda Eloy | CONTEÚDO DE MARCA', 'description': 'Foi na unidade Firjan SENAI de Duque de Caxias, no Rio, que Idenilda Lima Eloy ingressou em um curso que mudaria sua vida profissional. Ela já tinha mais de 60 anos quando abriu uma empresa de uniformes e ingressou nos cursos de operação de máquinas — era a aluna mais velha entre jovens — e de modelagem. 

“Não tenho palavras para descrever como o Senai mudou a minha trajetória. Mesmo com a crise, não parei de trabalhar, me reinventei com os cursos e me adaptei”. 

A peça de seu projeto final foi feita com um tecido two way com elastano.', 'thumbnails': {'default': {'url': 'https://i.ytimg.com/vi/dYZia_3XVHg/default.jpg', 'width': 120, 'height': 90}, 'medium': {'url': 'https://i.ytimg.com/vi/dYZia_3XVHg/mqdefault.jpg', 'width': 320, 'height': 180}, 'high': {'url': 'https://i.ytimg.com/vi/dYZia_3XVHg/hqdefault.jpg', 'width': 480, 'height': 360}, 'standard': {'url': 'https://i.ytimg.com/vi/dYZia_3XVHg/sddefault.jpg', 'width': 640, 'height': 480}, 'maxres': {'url': 'https://i.ytimg.com/vi/dYZia_3XVHg/maxresdefault.jpg', 'width': 1280, 'height': 720}}, 'channelTitle': 'Jornal O Globo', 'playlistId': 'UU-6xqzMBF2CXTImn_a4aCVg', 'position': 919, 'resourceId': {'kind': 'youtube#video', 'videoId': 'dYZia_3XVHg'}, 'videoOwnerChannelTitle': 'Jornal O Globo', 'videoOwnerChannelId': 'UC-6xqzMBF2CXTImn_a4aCVg'}

{'publishedAt': '2022-05-04T11:30:06Z', 'channelId': 'UC-6xqzMBF2CXTImn_a4aCVg', 'title': 'Veja quem brilha nos bastidores do samba: a produtora Jacqueline Marttins', 'description': 'Jacqueline Martins é um dos personagens que trabalha duro para que as pessoas se divirtam em uma roda de samba. Produtora do Samba do Trabalhador, liderado por Moacyr Luz, ela trabalha há 20 anos no setor da cultura, fazendo gestão e produção na área musical. Além da roda que acontece toda segunda-feira, ela é produtora executiva do grupo Casuarina, do bloco de carnaval Empolga às 9 e do sambista Moyseis Marques.  

Este é o quinto episódio da série "Negócio é o nosso samba". Uma série do Movimento Tem no Rio, parceria entre a Invest.Rio, agência de atração de investimentos da Prefeitura do Rio, e a Editora Globo. 

