{'publishedAt': '2022-05-03T11:30:03Z', 'channelId': 'UC-6xqzMBF2CXTImn_a4aCVg', 'title': 'Feira das Yabás e Trem do Samba: o legado de Marquinhos de Oswaldo Cruz', 'description': 'Músico, cantor e compositor, Marquinhos de Oswaldo Cruz encabeça uma série de movimentos que resgata a valorização do bairro que dá nome à sua alcunha artística. Criador da Feira das Yabás e do Trem do Samba, ele também foi um dos pioneiros no processo de revitalização da Lapa, no início dos anos 2000. Ao longo de sua carreira, fez parcerias com nomes como Candeia, Arlindo Cruz, Xande de Pilares, Pedro Luís e Toninho Nascimento.  

Este é o quarto episódio da série "Negócio é o nosso samba". Uma série do Movimento Tem no Rio, parceria entre a Invest.Rio, agência de atração de investimentos da Prefeitura do Rio, e a Editora Globo. 

