{'publishedAt': '2022-05-02T11:30:11Z', 'channelId': 'UC-6xqzMBF2CXTImn_a4aCVg', 'title': 'Saiba quem é Jane Pereira, a Mulher Jiló', 'description': 'Jane Pereira é um dos personagens que está nos bastidores das rodas de samba. Viúva do compositor Luiz Carlos da Vila, Jane é cozinheira de mão cheia e ganhou o apelido de Mulher Jiló devido ao seu famoso jiló frito. Na Feira das Yabás, que acontece todo segundo domingo do mês em Madureira, o público faz fila para provar sua iguaria. Enquanto Luiz Carlos era vivo, por incentivo de Jane, ela servia caldos e petiscos e ele conduzia uma roda de samba para os amigos na casa do casal.  

Este é o terceiro episódio da série "Negócio é o nosso samba". Uma série do Movimento Tem no Rio, parceria entre a Invest.Rio, agência de atração de investimentos da Prefeitura do Rio, e a Editora Globo. 

