{'publishedAt': '2022-05-01T13:00:35Z', 'channelId': 'UC-6xqzMBF2CXTImn_a4aCVg', 'title': 'Conheça o trabalho do empresário, designer gráfico e compositor Igor Leal', 'description': 'Compositor, designer gráfico, empresário. Igor Leal domina a arte da criação em todas as vertentes. Nas escolas de samba, já foi componente, mestre-sala, ritmista, diretor de bateria, de harmonia e de carnaval, além de compositor de 82 sambas-enredo que passaram pela Marquês de Sapucaí. Depois de consagrado no carnaval, Leal criou a grife de moda D’Samba, que reúne lojas de roupa, casas de show, bar e restaurante em um mesmo espaço.  

Este é o segundo episódio da série "Negócio é o nosso samba". Uma série do Movimento Tem no Rio, parceria entre a Invest.Rio, agência de atração de investimentos da Prefeitura do Rio, e a Editora Globo. 

