{'publishedAt': '2022-03-07T11:00:26Z', 'channelId': 'UC-6xqzMBF2CXTImn_a4aCVg', 'title': 'Pelé da Praia dá aula de vôlei e tem vários serviços nas areias do Leblon, no Rio de Janeiro', 'description': 'A Barraca do Pelé começou quando Robenildo Quintino ainda tinha 10 anos de idade. Ele ajudava o pai na barraca. Ele se formou em educação física e uniu suas duas paixões: vôlei e praia. A barraca de Robenildo é famosa por ter instalado um chuveiro em 1995. Em frente à barraca, ele recebe seus alunos. 

Este é o terceiro episódio da série "Negócio é a nossa praia". Uma série do movimento Tem no Rio, parceria entre a Invest.Rio, agência de atração de investimentos da Prefeitura do Rio, e a Editora Globo, plataforma tem programação para os setores da moda, inovação, gastronomia, educação, lazer e cultura.

